import React from 'react'

export function collaps(client) {
    return (
        <div className='position-relative text-center py-2 px-4'>
            <div className="collapse" id={`${client._id}`}>
                <div className="card card-body">
                    <div className='row text-center'>
                        {client.nombre}
                    </div>
                </div>
            </div>
        </div>
    )
}
